import MemoryCard from '../MemoryCard/MemoryCard';

import classes from './MemoryCards.module.css';

const memoryCards = [
    {
        id: 1,
        pairId: 'A',
        title: 'A',
        revealed: false,
    },
    {
        id: 2,
        pairId: 'B',
        title: 'B',
        revealed: false,
    }
];

const MemoryCards = () => {
    return (
        <div className={classes.MemoryCards}>
            <MemoryCard card={memoryCards[0]}/>
            <MemoryCard card = {memoryCards[1]}/>
        </div>
    );
}

export default MemoryCards;
